DELIMITER $$

/*!50003 CREATE DEFINER=`ncsoftwa_re`@`%` PROCEDURE `Stock_Cons`(
IN p_local int,
IN p_parametro VARCHAR(200)
)
BEGIN
SELECT
    `stock`.`IdArticuloSTK`
    , `articulos`.`DescripcionART`
    , `stock`.`CantidadSTK`
FROM
    `pos_desktop`.`stock`
    INNER JOIN `pos_desktop`.`articulos` 
        ON (`stock`.`IdArticuloSTK` = `articulos`.`IdArticuloART`)
    WHERE ((IdLocalSTK = p_local) AND (IdArticuloSTK LIKE concat(p_parametro,'%') 
	or DescripcionART LIKE CONCAT('%',p_parametro,'%')) and CantidadSTK >0)
    ORDER BY DescripcionART ASC;END */$$
